import React from "react";
import { View } from "react-native";
import MainList from "./MainList";

const ResultListContainer = ({ restaurantList }) => {
  return (
    <View>
      <MainList
        restaurantName={restaurantList[0].restaurantName}
        distance={restaurantList[0].distance}
      />
      <MainList
        restaurantName={restaurantList[1].restaurantName}
        distance={restaurantList[1].distance}
      />
      <MainList
        restaurantName={restaurantList[2].restaurantName}
        distance={restaurantList[2].distance}
      />
    <MainList
        restaurantName={restaurantList[2].restaurantName}
        distance={restaurantList[2].distance}
      />
    </View>
  );
};

